`,paraId:138,tocIndex:141},{value:"POST ",paraId:139,tocIndex:142},{value:"https://api.zan.top/node/v1/eth/mainnet/{apiKey}",paraId:139,tocIndex:142},{value:"Creates a filter object based on filter options to enable notifications (logs) for state changes.",paraId:140,tocIndex:143},{value:`
